import React from "react";
import { useSelector } from "react-redux";

const Welcome = (props) => {
  const loginState = useSelector((state) => state.auth.isLoggedin);
  return (
    <div>Welcome {loginState ? localStorage.getItem("username") : "user"}</div>
  );
};

export default Welcome;
